import HotelCard from "../components/HotelCard";
import Footers from "../components/Footers";
import Banners from "../components/Banners";
import Categories from "../components/Categories";
import CelebCarousel from "../components/CelebCarousel";

import { hotelListAction } from "../actions/advertiseActions2";

import ErrorMessage from "../components/ErrorMessage";
import Loaders from "../components/Loader";

const celeb = {
  title: "title",
  urlToImage:
    "https://staticg.sportskeeda.com/editor/2021/11/caca5-16370851386444-1920.jpg",
  description: "description",
  author: "author",
  content: "content",
};
const Hotels = () => {
  const dispatch = useDispatch();
  const hotelList = useSelector((state) => state.hotelList);
  const {
    error: ListHotelError,
    loading: listHotelLoading,
    hotels: listHotel,
  } = hotelList;

  useEffect(() => {
    dispatch(hotelListAction());
  }, [dispatch]);

  return (
    <div>
      <CelebCarousel celeb={celeb} />
      <Banners />
      <Categories />
      <div className="tourist_screen">
        <div className="tourist_event">hi</div>
        {listHotelLoading ? (
          <Loaders />
        ) : istHotelError ? (
          <ErrorMessage type="error" error={listHotelError} />
        ) : (
          <div className="tourist_main">
            {listHotel.map((hotel) => (
              <HotelCard key={hotel.id} hotel={hotel} />
